Electric Light Orchestra - Ticket to the Moon [promo].VOB



Very HQ rare promo music video. &quot;Ticket To The Moon&quot; is a popular rock song written by Jeff Lynne and performed by Electric Light Orchestra.

It was track four on the album Time and was released as a Double A along with &quot;Here Is The News&quot; in January 1982 , reaching #24 in the UK charts. The song is somewhat reminiscent of their earlier output, featuring grand piano and more strings than their past few singles. Rainer Pietsch conducted the strings on the song. This promo video features Mik Kaminski on violin.

Time is a concept album by Electric Light Orchestra released in 1981. The album tells the story, through its songs and lyrics, about a man from the 1980s finding himself in the year 2095 and trying to come to terms with being unable to return and adjusting to his new surroundings.

This single was also released as a limited edition 12&quot; picture disc showing the ELO spaceship, The same image was later used as the sleeve design for the UK follow up single The Way Life's Meant to Be.

The name was used for a compilation album in 2007, &quot;Ticket to the Moon: The Very Best of Electric Light Orchestra Volume 2&quot;.
